import React from 'react';
import './styles.css';

const App = () => {
    return (
        <>
            <body className="min-h-screen bg-gradient-to-b from-grey-800 to-grey-600"></body>
        </>
    );
}
// first commit comment

const NewBubbleButton = () => {
    return (
        <button className="newBubbleButton">
            +
        </button>
    )
}
export default App;
